import styled from "styled-components";
import { Facebook, Instagram, Twitter } from "@material-ui/icons";

const Container = styled.div`
  display: flex;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 2rem;
`;
const Center = styled.div`
  flex: 1;
`;
const Right = styled.div`
  flex: 1;
`;

const Logo = styled.h1``;

const Description = styled.p`
  margin: 2rem 0;
`;
const SocialContainer = styled.div`
  display: flex;
`;
const SocialIcon = styled.div`
  width: 3rem;
  height: 3rem;
`;

const Footer = () => {
  return (
    <Container>
      <Left>
        <Logo>Z&X</Logo>
        <Description>
          Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quasi libero
          perspiciatis aperiam sed ex laboriosam explicabo nobis vitae
          reiciendis quisquam? Sed blanditiis et reiciendis neque velit qui
          tempore dolorem ullam.
        </Description>
        <SocialContainer>
          <SocialIcon>
            <Facebook />
          </SocialIcon>
          <SocialIcon>
            <Instagram />
          </SocialIcon>
          <SocialIcon>
            <Twitter />
          </SocialIcon>
        </SocialContainer>
      </Left>
      <Center></Center>
      <Right></Right>
    </Container>
  );
};

export default Footer;
